import React from 'react'
import {Tile, Props as TileProps} from './tile.component'
export type {Props as TileProps} from './tile.component'

interface Props {
	content:TileProps["content"][]
}


export default class TileGrid extends React.Component<Props> {

  	render() {return (
		<div className="tileGrid">{
			this.props.content.map((content,i)=>
				<Tile key={i} content={content} />
			)
		}</div>  
  	)}

}
